// Componente que simula el perfil de un usuario (foto, bio, datos, etc...) en formato card
import React from 'react';

export function Card(data) {
    return (
        <div className="card">
        <img src={data.img} alt="Avatar" />
        <div className="container">
            <h4><b>{data.name}</b></h4>
            <p>{data.bio}</p>
        </div>
        </div>
    );
    }
